import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../stylesheets/riderForm.css';
import Button from 'react-bootstrap/Button';
import ButtonGroup from 'react-bootstrap/ButtonGroup';
import Form from 'react-bootstrap/Form';

class RiderFormPage extends Component{
  render()
  {
    return (
      <div className="RiderFormPage">
          <h2><b>RIDER</b></h2>
          <p></p>
          <p>Please answer the following</p>
          <hr></hr>
          <p>Direction</p>
          <div>
              <ButtonGroup className="toggleButtons" aria-label="Basic example">
                  <Button className="directionButton" variant="danger">From McMaster</Button>
                  <Button className="directionButton" variant="danger">To McMaster</Button>
              </ButtonGroup>
          </div>
          <p></p>
          <div>
            <Form>
                <Form.Group controlId="formGridCity">
                  <Form.Label>Destination City</Form.Label>
                  <Form.Control />
                </Form.Group>
            </Form>
          </div>
          <br></br>
          <p><i>DeltaHacksVI Project 2020</i></p>
      </div>
    );
  }
}

export default RiderFormPage;
